import React, { Component } from "react";
import Question from './Question'
import "./Questions.css";

class Questions extends Component {

  constructor(props) {
    super(props);
    this.startTime = Date.now();
  }

  recordTime = () => {
    var timeElapsed = Date.now() - this.startTime;
    console.log(timeElapsed);
  }

  render() {
    const questions = [
      "Can I use Purell/hand sanitizer?", 
      "How long do I wash my hands for?",
      "How long do I keep the band-aid for?",
      "Unanswerable"
    ];

    return (
      <div className="questions mt-5">
        <h2>Questions</h2>
        <hr/>
        {questions.map((question, i) => 
            <Question key={i} data_index={i+1} question={question}></Question>
        )}
        <div className="container mt-5">
              <button type="button" onClick={this.recordTime} className="btn ml-3 btn-dark btn-lg">Reply</button>
              <button type="button" onClick={this.recordTime} className="btn ml-3 btn-dark btn-lg">Repeat</button>
              <button type="button" onClick={this.recordTime} className="btn ml-3 btn-dark btn-lg">Done</button>
        </div>
      </div>
    );


  }
}

export default Questions;
